// src/components/Layout.js
import React from "react";
import { Link } from "react-router-dom";

const navData = [
  {
    // fontSize: 'h5',
    link: '/about',
    text: 'WHO IS THIS GUY?',
    classes: 'four columns small'
  },
  {
    // fontSize: 'h4',
    link: '/',
    text: 'ANDREW FITZPATRICK',
    classes: 'four columns large'
  },
  {
    // fontSize: 'h5',
    link: '/contact',
    text: 'SAY HI',
    classes: 'four columns small'
  }
];


const Header = () => {
  return (
    <header>
      <nav>
        <div className="container">
          <div class="row">
            navData.map ((value, i) => {
              <div className = {navData.classes} >
                <Link to = {navData.link} >
                  {navData.text}
                </Link>
              </div>
            });
            <div className="four columns small">
              <h5>
                <Link to="/about">
                  WHO IS THIS GUY?
                </Link>
              </h5>
            </div>
            <div className="four columns large">
              <h4>
                <Link to="/">
                  ANDREW FITZPATRICK
                </Link>
              </h4>
            </div>
            <div className="four columns small">
              <h5>
                <Link to="/contact">
                  SAY HI
                </Link>
              </h5>
            </div>
          </div>
        </div>
      </nav>
    </header>
  );
};

export default Header;
